import React, { Component } from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import { Home } from './Home';
import { About } from './About';
import { Contact } from './Contact';
import { CV } from './CV';
import { Work } from './Work';
import { NoMatch } from './NoMatch';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <Router>
          <Switch>
            <Route path = "/">
              <Home />
            </Route>
            <Route path = "/about">
              <About />
            </Route>
            <Route path = "/work">
              <Work />
            </Route>
            <Route path = "/cv">
              <CV />
            </Route>
            <Route path = "/contact">
              <Contact />
            </Route>
            <Route>
              <NoMatch />
            </Route>
          </Switch>
        </Router>
      </React.Fragment>
    );
  }
}

export default App;
